import logo from './logo.svg';
import './App.css';
import Navbar from './Navbar';

function App() {
  const title = 'welcome to the new blog';
  const likes = 50;
  const person = {
    name: 'Debs',
    age: 20,
    sport: 'rugby'
  }
  const link = "https://www.canva.com/";


  return (
    <div className="App">
      <Navbar />

      <div className="content">
        <h1>{title} <img src={logo} alt="lgo"></img></h1>
        <p>{person.name} loves to play {person.sport} all day!</p>
        <a href={link}>Link</a>
      </div>

    </div>
  );

}

export default App;
